  \"2016-01-28T07:27:38.183367\",\n\t\"name\": \"rsbs-single-family-on-site-inspections-site-level-new-york-state-residential-statewide-bas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The New York State Energy Research and
  Development Authority (NYSERDA), in collaboration with the New York State Department
  of Public Service (DPS), conducted a statewide residential baseline study (study)
  from 2011 to 2014 of the single-family and multifamily residential housing segments,
  including new construction, and a broad range of energy uses and efficiency measures.
  \ This dataset includes data collected from a total of 700 on-site inspections of
  single family buildings. The types of data collected during the inspections covers
  property characteristics, heating and cooling equipment, water heating equipment,
  appliances, lighting, clothes washing and drying, miscellaneous energy using equipment,
  and observable operating behavior.  The objective of the inspections was to enhance
  the residential baseline study with detailed on-site information and, to the degree
  possible, verify self-reported data from the phone and web surveys.\",\n\t\"license_title\":
